qCond.qv:
If(
	// If there is only 1 available month don't show since it will auto drill
	Count({1}DISTINCT ThreadInteractionMonthYear)<>1,
  	If(
    	// If one month is not selected or possible and if it is the current month, show the forecast
    	GetPossibleCount(ThreadInteractionMonthYear)>1
        ,1,0
    )
)
